import React from 'react';
import './Header.css';

export default () => {
    return (
        <header>
            <div class="header--logo">
                <a alt="Netflix" href="https://upload.wikimedia.org/wikipedia/commons/0/Of/Logo_Netflix.png"></a>
            </div>
        </header>
    );
}
